B.J4=new A.bv('Thank you for choosing to be part of our community at MovieX ("Company," "we," "us," or "our"). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about this privacy notice or our practices with regard to your personal information, please contact us at MovieX.',null,B.ag,null,null,null)
B.Je=new A.bv('This privacy notice describes how we might use your information if you:\n  * Download and use our mobile application \u2014 MovieX \n  * Engage with us in other related ways \u2015 including any sales, marketing, or events \n In this privacy notice, if we refer to:\n  * "App," we are referring to any application of ours that references or links to this policy, including any listed above\n  * "Services," we are referring to our App, and other related services, including any sales, marketing, or events \n The purpose of this privacy notice is to explain to you in the clearest way possible what information we collect, how we use it, and what rights you have in relation to it. If there are any terms in this privacy notice that you do not agree with, please discontinue use of our Services immediately.',null,null,null,null,null)
B.Ic=new A.m(!0,null,null,null,null,null,15,B.X,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
